const initialState = '';

export const test = (player, name) => ({
    type: 'SET_NAME',
    player,
    name
});

const winningSquaresReducer = (state = initialState, action) => {
    switch (action.type) {
        case 'SET_NAME':
            console.log('svsfd?');
            return '';
        default:
            return state;
    }
};

export default winningSquaresReducer;
